import React from 'react';
import './Login1.css';
import { IconHolberton } from '../Componentes/IconHolberton/IconHolberton';
import { UserStudent } from '../Componentes/UserStudent/UserStudent';
import { UserPartner } from '../Componentes/UserPartner/UserPartner';
import { UserAdmin } from '../Componentes/UserAdmin/UserAdmin';

function Login1() {
  return (
    <div className='Login1Container'>
      <div className='Icon'>
        <IconHolberton />
      </div>
      <div className='Buttons'>
        <UserStudent />
        <UserPartner />
        <UserAdmin />
      </div>
    </div>
  );
}

export { Login1 };
